const NavBar= () =>{
    return(
       <nav>
            <div></div>
            <img src={Imagen} className="imagen"/>
            <ul>
                <NavLink to='/' className='space'>Inicio</NavLink>
                <Link to='/Contactos'>
                <Contactos/>Contactos
                 </Link>
                <NavLink to='/category/Nosotros'className='space'>Nosotros</NavLink>
            </ul>
            <Link to='/cart'>
        <CartWidget/>
        </Link>
        </nav>
    )
}
export default NavBar;
